def proc(t2c_params, stage_index):
    """
    requant_vector不需要任何操作，直接inline
    """

    stages = t2c_params.schedule.stages

    if stages[stage_index].op.tag in ["requant_vector", "requant_s16_vector"]:
        return True

    return False
